import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Navbar.css'; // Import the CSS file for styling
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser } from '@fortawesome/free-solid-svg-icons';
import { faHome } from '@fortawesome/free-solid-svg-icons';
import { faSignInAlt } from '@fortawesome/free-solid-svg-icons';
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import { faUserCircle } from '@fortawesome/free-solid-svg-icons'; // for profile icon
import logo from '../images/logo.png';

// ...
const Navbar = ({ isLoggedIn, isLoggedOut, handleLogout }) => {
  const logout = () => {
    // Perform logout actions (e.g., clear authentication tokens)
    // After successful logout, call the handleLogout function from the parent component
    handleLogout();
  };

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <h3 className="navbar-title">
          <img src={logo} alt="Talent Tracker" />
        </h3>
      </div>
      <ul className="navbar-list">
        {!isLoggedIn && !isLoggedOut && (
          <>
            <li className="navbar-item">
              <Link to="/" className="navbar-link">
                <FontAwesomeIcon icon={faHome} /> Home
              </Link>
            </li>
            <li className="navbar-item">
              <Link to="/about" className="navbar-link">
                <FontAwesomeIcon icon={faUser} /> About
              </Link>
            </li>
            <li className="navbar-item">
              <Link to="/login" className="navbar-link">
                <FontAwesomeIcon icon={faSignInAlt} /> Login
              </Link>
            </li>
          </>
        )}
        {isLoggedIn && (
          <>
            <li className="navbar-item">
              <Link to="/profile" className="navbar-link">
                <FontAwesomeIcon icon={faUserCircle} /> Profile
              </Link>
            </li>
            <li className="navbar-item">
            <Link to="/profile" className="navbar-link">
                <FontAwesomeIcon icon={faUserCircle} /> Profile
              </Link>
              {/* <button className="navbar-link" onClick={logout}>
                <FontAwesomeIcon icon={faSignOutAlt} /> Logout
              </button> */}
            </li>
          </>
        )}
        {isLoggedOut && (
          <>
            <li className="navbar-item">
              <Link to="/" className="navbar-link">
                <FontAwesomeIcon icon={faHome} /> Home
              </Link>
            </li>
            <li className="navbar-item">
              <Link to="/about" className="navbar-link">
                <FontAwesomeIcon icon={faUser} /> About
              </Link>
            </li>
            <li className="navbar-item">
              <Link to="/login" className="navbar-link">
                <FontAwesomeIcon icon={faSignInAlt} /> Login
              </Link>
            </li>
          </>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
